import Helmet from "react-helmet";
import Header from "../../comps/header/Header";
import conf from '../../config.json'
class AboutUs extends Component {
    render() {
        return (
          <React.Fragment>
            <Helmet>
                <title>About Us</title>
            </Helmet>
            <Header/>
            <h1>ABOUTUS</h1>
          </React.Fragment>
        );
    }
}

export default AboutUs;
